import {fetchUsers} from './redux/DummyApi';
import {useSelector, useDispatch} from 'react-redux'
import React from 'react';

export default function MainFile(){
    const state = useSelector(state => state);
    // mapDispatchToProps
    const dispatch = useDispatch();
    let {loading, errors, users} = state;

    React.useEffect(() => {
        dispatch(fetchUsers());
    }, []);

    return <>
            {
                loading ? <h4>Loading ... </h4>:users.map(user => {return <h4 key = {user.id}>{user.name}</h4>})

            }
        </>

}
